tables.table_schema:
CREATE TABLE ExecutionPatterns (
    pattern_id INT PRIMARY KEY,
    pattern_description TEXT,
    pattern_start_date DATE,
    pattern_end_date DATE
);

CREATE TABLE algorithm_logs ( 
    log_id INT PRIMARY KEY, 
    execution_id INT, 
    log_message TEXT, 
    log_timestamp TIMESTAMP 
);

CREATE TABLE algorithm_results ( 
    result_id INT PRIMARY KEY, 
    execution_id INT, 
    result_data JSON, 
    result_timestamp TIMESTAMP 
);
